import React, {useState, useEffect} from 'react';
import './App.css';

const List = () => {
  const [todos, setTodos] = useState([]);
  const fetchTodos = async () => {
    const res = await fetch('http://localhost:3001/todos');
    console.log(res.json);
    setTodos(res);
  }
  useEffect(() => {
    fetchTodos();
  }, []);

  return (<div>{todos}</div>)
}
 const item = (props) => {
  const {done, desc} = props.todos
  return (<div> {done} {desc} </div>)
 }

function App() {

  return (
    <div className="App">
      <h1> Todos </h1>
      <List/>
    </div>
  );
}

export default App;
